import React from 'react';
import ReactDOM from 'react-dom';

const App = () => {

    windows.navigator.geolocation.getCurrentPosition(
        (position) => console.log(position),
        (err) => console.log(err)
    );
    return(
        <div>Hi There !</div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
